    external
    virtual
    override
  {
    bytes32 orgId = createOrgId(salt, orgJsonUri);

    if (dids.length > 0) {
      addDelegates(orgId, dids);
    }
  }

  /**
   * @dev See {IOrgIdFeat-setOrgJson(bytes32,string,string[])}.
   */
