      bytes32 orgId,
      string calldata orgJsonUri,
      string[] calldata dids
  )
    external
    virtual
    override
  {
    setOrgJson(orgId, orgJsonUri);

    if (getDelegates(orgId).length > 0) {
      removeDelegates(orgId);
    }

    if (dids.length > 0) {
      addDelegates(orgId, dids);
    }
